CREATE TABLE IF NOT EXISTS customers(
   cus_lastname    VARCHAR(30) NOT NULL
  ,cus_firstname   VARCHAR(30) NOT NULL
  ,cus_status      VARCHAR(13) NOT NULL
  ,cus_coefficient INTEGER  NOT NULL
  ,cus_ref         VARCHAR(13) NOT NULL
  ,cus_address     VARCHAR(70) NOT NULL
  ,cus_zipcode     INTEGER  NOT NULL
  ,cus_city        VARCHAR(50) NOT NULL
  ,cus_countries   VARCHAR(30) NOT NULL
  ,cus_phone       VARCHAR(20) NOT NULL
  ,cus_mail        VARCHAR(60) NOT NULL
  ,cus_emp_id      INTEGER  NOT NULL
);
